import React from "react";
import { useLocation } from "react-router";
import { useState } from "react";

export default function ServiceUser() {
  const location = useLocation();
  const [index, setIndex] = useState(0);

  const temp = JSON.parse(localStorage.getItem(location.state.service));

  temp.filter((object, index) => {
    if (object.id === location.state.id) {
      //   setIndex(index);
      object.name = "sss";
    }
  });

  const handel = () => {
    localStorage.setItem(location.state.service, JSON.parse({ id: "hii" }));
    console.log(temp);
  };

  return (
    <div>
      {temp.map((item, i) => {
        return <h1 key={i}>{item.id}</h1>;
      })}
      <button onClick={handel}></button>
    </div>
  );
}
